import React, { Component } from "react";
import { StyleSheet, View, Image, Text } from "react-native";
import GoBackBtn from "./GoBackBtn";
import OneTimeSelectableOptionGroup from "./OneTimeSelectableOptionGroup";
import DropdownSelectableOption from "./DropdownSelectableOption";
import AddToCartBtn from "./AddToCartBtn";

function ProductBuilderModal(props) {
  return (
    <View style={styles.container}>
      <View style={styles.productBuilderGroup}>
        <View style={styles.goBackRow}>
          <GoBackBtn style={styles.goBackBtn} />
        </View>
        <View style={styles.leftRightGroup}>
          <View style={styles.leftSideGroup}>
            <View style={styles.itemInfoContainer}>
              <Image
                source={require("../../assets/images/image_xJCw..png")}
                resizeMode="contain"
                style={styles.itemImg}
              ></Image>
              <View style={styles.itemInfoTxtGroup}>
                <View style={styles.topTxtGroup}>
                  <Text style={styles.productName}>Veggie Pizza</Text>
                  <Text style={styles.calorieDetails}>280 cal/slice</Text>
                </View>
                <Text style={styles.description}>
                  Description: Tomato sauce, mozzarella cheese, mushroom, sliced
                  tomato, red onions, green pepper
                </Text>
              </View>
            </View>
            <View style={styles.writeNoteContainer}>
              <Text style={styles.notesLbl}>Notes:</Text>
              <View style={styles.noteInput}>
                <Text style={styles.noteInputTxt}>
                  Write any extra info here...
                </Text>
              </View>
            </View>
          </View>
          <View style={styles.rightSideGroup}>
            <OneTimeSelectableOptionGroup
              style={styles.oneTimeSelectableOptionGroup}
            ></OneTimeSelectableOptionGroup>
            <DropdownSelectableOption
              style={styles.dropdownSelectableOption}
            ></DropdownSelectableOption>
            <DropdownSelectableOption
              style={styles.dropdownSelectableOption1}
            ></DropdownSelectableOption>
            <DropdownSelectableOption
              style={styles.dropdownSelectableOption2}
            ></DropdownSelectableOption>
            <DropdownSelectableOption
              style={styles.dropdownSelectableOption3}
            ></DropdownSelectableOption>
            <View style={styles.totalLblRow}>
              <Text style={styles.totalLbl}>Total: $10.00</Text>
            </View>
          </View>
        </View>
        <View style={styles.addToCartRow}>
          <AddToCartBtn style={styles.addToCartBtn}></AddToCartBtn>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#edf2ff",
    width: "100%",
    height: "100%",
  },
  productBuilderGroup: {
    width: '80%',
    height: '80%',
    justifyContent: "space-between",
  },
  goBackRow: {
    height: '20%',
    alignSelf: "stretch",
  },
  goBackBtn: {
    height: 32,
    width: 126,
  },
  leftRightGroup: {
    height: '70%',
    flexDirection: "row",
    justifyContent: "space-between",
    alignSelf: "stretch",
  },
  leftSideGroup: {
    width: '30%',
    height: '100%',
    justifyContent: "space-between",
  },
  itemInfoContainer: {
    height: '60%',
    borderRadius: 20,
    backgroundColor: "rgba(255,255,255,1)",
    alignItems: "center",
    justifyContent: "flex-end",
    alignSelf: "stretch",
  },
  itemImg: {
    height: 217,
    width: 218,
  },
  itemInfoTxtGroup: {
    width: 214,
    height: 191,
    justifyContent: "space-between",
    alignItems: "center",
    margin: 0,
  },
  topTxtGroup: {
    width: 175,
    height: 59,
    marginTop: 7,
    marginBottom: 15,
  },
  productName: {
    fontWeight: "700",
    color: "#121212",
    fontSize: 30,
  },
  calorieDetails: {
    color: "rgba(131,126,126,1)",
    marginTop: 43,
    marginLeft: 48,
  },
  description: {
    color: "rgba(131,126,126,1)",
    width: 214,
    height: 67,
    textAlign: "left",
    marginTop: 7,
    marginBottom: 15,
  },
  writeNoteContainer: {
    height: 148,
    justifyContent: "space-between",
    alignSelf: "stretch",
  },
  notesLbl: {
    fontWeight: "700",
    color: "#121212",
  },
  noteInput: {
    width: 269,
    height: 126,
    backgroundColor: "rgba(255,255,255,1)",
  },
  noteInputTxt: {
    color: "#90949a",
    width: 256,
    height: 109,
    margin: 9,
  },
  rightSideGroup: {
    width: '50%',
    height: 470,
    justifyContent: "space-between",
    backgroundColor: "white",
    borderRadius: 10,
    padding: 20,
    paddingLeft: 30,
    paddingRight: 30,
  },
  oneTimeSelectableOptionGroup: {
    height: 82,
    marginTop: 0,
    alignSelf: "stretch",
  },
  dropdownSelectableOption: {
    height: 44,
    marginTop: 0,
    alignSelf: "stretch",
  },
  dropdownSelectableOption1: {
    height: 44,
    marginTop: 0,
    alignSelf: "stretch",
  },
  dropdownSelectableOption2: {
    height: 44,
    marginTop: 0,
    alignSelf: "stretch",
  },
  dropdownSelectableOption3: {
    height: 44,
    marginTop: 0,
    alignSelf: "stretch",
  },
  totalLblRow: {
    height: 22,
    flexDirection: "row",
    justifyContent: "flex-end",
    alignSelf: "stretch",
  },
  totalLbl: {
    fontWeight: "700",
    color: "#00c937",
    fontSize: 22,
    marginTop: 0,
  },
  addToCartRow: {
    height: 41,
    flexDirection: "row",
    justifyContent: "flex-end",
    alignSelf: "stretch",
  },
  addToCartBtn: {
    height: 41,
    width: 147,
  },
});

export default ProductBuilderModal;
